		return <UserLink />
	}
	
	return <GuestLink />
}

function GuestLink(props) {
	const navStyle = {
		color: 'white'
	};
	
	return (
		<nav className="navClass">
			<ul className="nav-links">
				<h2></h2>
				<Link style={navStyle} to="/">
					<li>24/7 Recipes</li>
				</Link>
				<Link style={navStyle} to="/testpage">
					<li>Test Page</li>
				</Link>
				<Link style={navStyle} to="/login">
					<li>Login</li>
				</Link>
			</ul>
		</nav>
	)
}

function UserLink(props) {
	const navStyle = {
		color: 'white'
	};
	
	return (
		<nav className="navClass">
			<ul className="nav-links">
				<h2></h2>
				<Link style={navStyle} to="/">
					<li>24/7 Recipes</li>
				</Link>
				<Link style={navStyle} to="/testpage">
					<li>Test Page</li>
				</Link>
				<Link style={navStyle} to="/user">
					<li>My Pantry</li>
				</Link>
				<Link style={navStyle} to="/logout">
					<li>Logout</li>
				</Link>
			</ul>
		</nav>
	)
}

export default Nav;
